import React from 'react';

const UserPage = () => {
  const { user: { username, avatar_url } } = { "user": { "username": "tickle122", "avatar_url": "https://www.spiritsurfers.net/monastery/wp-content/uploads/_41500270_mrtickle.jpg", "name": "Tom Tickle" } }
  return <div>
    <p>Username: {username}</p>
    <p>Avatar_url: {avatar_url}</p>
  </div>
}

export default UserPage;
